"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nBuilt the altar in the chapel of Bom Jesus in Matriz de de Santa Cruz da Lagoa<br />\nUm dos primeiros povoadores da ilha de S\u00e3o Miguel, para onde veio da Madeira com Rui Gon\u00e7alves da C\u00e2mara, terceiro Capit\u00e3o-Donat\u00e1rio de S. Miguel.<br />\nEra natural de Ponte de Lima ou de Guimar\u00e3es, e foi ter \u00e0 Madeira fugido de seupai.<br />\nRecebeu do Capit\u00e3o-Donat\u00e1rio Rui Gon\u00e7alves da C\u00e2mara muitas dadas de terras de sesmaria no termo da vila da Lagoa (Frutuoso, Liv. IV, Cap. XIX).<br />\nVeio para S.Miguel cerca de 1474 e depois de vi\u00favo foi morar em Ponta Gar\u00e7a, junto a Nossa Senhora da Esperan\u00e7a, que edificou e deu ao povo para servir de par\u00f3quia. Fez testamento e nele deixou umas missas por alma de seu sogro, Jo\u00e3o do Porto (talvez casasse 2\u00aa vez).<br />\nCom sua mulher instituiu um v\u00ednculo, de que deu contas nos Res\u00edduos em 1599, seu neto Rui Vaz de Medeiros.<br />\nFoi sepultado com a mulher numa capela que edificaram em Santa Cruz - Lagoa. Casou na Madeira, antes de 1474 com Ana Gon\u00e7alves de Mendon\u00e7a.\n</p>\n<p>\nHouve um Rui Vaz de Medeiros que foi dos primeiros povoadores da Ilha da Madeira e ali teve terras de sesmaria na Ribeira de Atabua (Vid. \"Saudades da Terra\", Liv. II, pag. 526, edi\u00e7\u00e3o de \u00c1lvaro Rodrigues de Azevedo).<br />\nJo\u00e3o Agostinho Pereira de Agrela, nas suas \"Mem\u00f3rias Geneol\u00f3gicas\", Tomo III, pag. 400 verso, diz que Rui Vaz de Medeiros e sua mulher Ana Gon\u00e7alves de Mendon\u00e7a, tiveram, al\u00e9m dos filhos que Frutuouso aponta, mais Jorge Vaz de Medeiros, que morreu afogado e uma filha freira. Diz que Ana Gon\u00e7alves \u00e9 filha de Jorge de Mendon\u00e7a Furtado. Diz mais que Rui Vaz de Medeiros \u00e9 filho de Vasco de Medeiros, morador em Ponte de Lima, neto de Gon\u00e7alo Roiz de Medeiros, tamb\u00e9m morador em Ponte de Lima, no tempo de D.Jo\u00e3o I, e bisneto de Rui Gon\u00e7alves de Medeiros, partid\u00e1rio de D. Jo\u00e3o I, Alcaide do Castelo de \u00c9vora, como consta da \"Cr\u00f3nica de D. Jo\u00e3o I\", por Fern\u00e3o LOpes, Parte 1\u00aa, Cap. 44. Estes dizem ser filho de Gon\u00e7alo Martins, filho por seu turno, de Martim Sanches das Medas, de que fala o \"Nobili\u00e1rio\" do Conde D. Pedro.\n</p>\n<p>\nIn : Fam\u00edlias Antigas da Povoa\u00e7\u00e3o - Natural de Ponte de Lima. Primeiro desta fam\u00edlia que veio para S. Miguel (Frutuouso, LivroIV). Viveu no termo da Lagoa e foi senhor de grande casa. Casou na Madeira com Ana Gon\u00e7alves filha de Jorge Gurtado de Mendon\u00e7a.\n</p>\n</div>\n</div>",
