"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nCatarina Mezas was born in Ponta Delgada, S\u00e3o<br />\nMiguel, A\u00e7ores. She died on 20 May 1561 in S\u00e3o Pedro,<br />\nPonta Delgada, S\u00e3o Miguel, A\u00e7ores.<br />\nCatarina de Mesa, a quem Frutuoso chama erradamente Francisca de Mesa (Liv.\u00d9B IV, Cap.\u00d9B XVII). Fez testamento com o marido em 1537 e morreu a 20.5.1561, jazendo em S. Pedro de Ponta Delgada. J\u00e1 vi\u00fava fez segundo testamento a 3.4.1561. Casou com Pedro de Teve (Cap.\u00d9B 12.\u00d9B \u00d9G 1.\u00d9B N.\u00d9B 2).\n</p>\n<p>\nCatarina Mezas was born in Ponta Delgada, S\u00e3o<br />\nMiguel, A\u00e7ores. She died on 20 May 1561 in S\u00e3o Pedro,<br />\nPonta Delgada, S\u00e3o Miguel, A\u00e7ores.<br />\nCatarina de Mesa, a quem Frutuoso chama erradamente Francisca de Mesa (Liv.\u00d9B IV, Cap.\u00d9B XVII). Fez testamento com o marido em 1537 e morreu a 20.5.1561, jazendo em S. Pedro de Ponta Delgada. J\u00e1 vi\u00fava fez segundo testamento a 3.4.1561. Casou com Pedro de Teve (Cap.\u00d9B 12.\u00d9B \u00d9G 1.\u00d9B N.\u00d9B 2).\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nQuando na cidade da Ponta Delgada ainda eram as casas de pau pique, veioa esta ilha um Fern\u00e3o de Mesa, castelhano, criado de el-rei D. Afonso deCastela (sic) (1), casado com sua mulher Isabel Franca, de que tinha umfilho e tr\u00eas filhas.<br />\nFern\u00e3o de Mesa, castelhano, fugido de Castela no tempo da revolta das comunidades (1520), veio para a ilha de S. Miguel (Frutuoso, Liv.\u00d9B IV, Cap.os III e XVII). Casou em Espanha com Isabel Fran\u00e7a, castelhana.<br />\nBuried -  in Sao Miguel 1520\n</p>\n<p>\nQuando na cidade da Ponta Delgada ainda eram as casas de pau pique, veioa esta ilha um Fern\u00e3o de Mesa, castelhano, criado de el-rei D. Afonso deCastela (sic) (1), casado com sua mulher Isabel Franca, de que tinha umfilho e tr\u00eas filhas.<br />\nFern\u00e3o de Mesa, castelhano, fugido de Castela no tempo da revolta das comunidades (1520), veio para a ilha de S. Miguel (Frutuoso, Liv.\u00d9B IV, Cap.os III e XVII). Casou em Espanha com Isabel Fran\u00e7a, castelhana.\n</p>\n</div>\n</div>",
