"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nGon\u00e7alo de Teve, foi o primeiro Almoxarife em S. Miguel e o primeiro desta fam\u00edlia que veio para a mesma ilha (Frutuoso, Liv.\u00d9B IV, Cap.\u00d9B VII). Segundo Frutuoso foi encarregado de, em conjunto com o Capit\u00e3o Donat\u00e1rio, fazer as dadas de terrenos em S. Miguel. Era filho de Gon\u00e7alo de Teve a quem Frutuoso, nas Saudades da Terra, chama Gon\u00e7alo de Ornelas Paim, o que \u00e9 engano, pois os descendentes nunca usaram os apelidos Ornelas e Paim, mas sim os apelidos Teve, Teive ou Teves.<br />\nIgnora-se com quem casou, mas diz Frutuoso que foram seus filhos:\n</p>\n<p>\nGon\u00e7alo de Teve, foi o primeiro Almoxarife em S. Miguel e o primeiro desta fam\u00edlia que veio para a mesma ilha (Frutuoso, Liv.\u00d9B IV, Cap.\u00d9B VII). Segundo Frutuoso foi encarregado de, em conjunto com o Capit\u00e3o Donat\u00e1rio, fazer as dadas de terrenos em S. Miguel. Era filho de Gon\u00e7alo de Teve a quem Frutuoso, nas Saudades da Terra, chama Gon\u00e7alo de Ornelas Paim, o que \u00e9 engano, pois os descendentes nunca usaram os apelidos Ornelas e Paim, mas sim os apelidos Teve, Teive ou Teves.<br />\nIgnora-se com quem casou, mas diz Frutuoso que foram seus filhos:\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPero or Pedro de Teve was Cavaleiro and son of Goncalo de Teve, one ofthe first settlers of Sao Miguel, orignally from Paris, France andCatharina de Mesa was daughter of Fernao de Mesa and Isabel Francanatives of Spain, came to Sao Miguel in 1520 at the time of the ComuneroRevolt.<br />\nPero was Amoxarife and cousin to Antonio de Teve, tesoureiro-mor(treasurer) of the king(?) He went with the 5th Capitao Donatario, RuiGoncalves da Camara, and served in Africa and Tangiers and Arzila.<br />\nAlmoxarife Pedro de Teves was born in Calheta, S\u00e3o Miguel, A\u00e7ores. He died after 1537 in Ponta<br />\nDelgada, S\u00e3o Miguel, A\u00e7ores. He married Catarina Mezas.<br />\nPedro de Teve, segundo Almoxarife em S. Miguel e Cavaleiro, segundo se v\u00ea de uma procura\u00e7\u00e3o feita em Ponta Delgada em 1518, de que foi testemunha e onde \u00e9 tratado de Cavaleiro (\"Arquivo dos A\u00e7ores\", Vol III, p\u00e1g.\u00d9A 26). Era primo de Ant\u00f3nio de Teve, Tesoureiro-m\u00f3r do Reino (?). Em 1516 Pedro de Teve foi com o 5.\u00d9B Capit\u00e3o Donat\u00e1rio, Rui Gon\u00e7alves da C\u00e2mara, servir em \u00c1frica, em T\u00e2nger e Arzila (Frutuoso, Liv.\u00d9B IV, Cap.\u00d9B LXVIII). Fez testamento de m\u00e3o comum com sua mulher em 1537, no qual deixaram 5 alqueires de terra \u00e0 Miseric\u00f3rdia de Ponta Delgada, para sustenta\u00e7\u00e3o de uma cama no hospital. Casou com Catarina de Mesa (Cap.\u00d9B 13.\u00d9B \u00d9G \u00danico N.\u00d9B 2), a quem Frutuoso tamb\u00e9m chama Francisca, por\u00e9m o seu verdadeiro nome \u00e9 Catarina, como consta dos dois testamentos que fez, o primeiro de m\u00e3o comum com seu marido em 1537 e o segundo a 3.4.1561.\n</p>\n<p>\nPero or Pedro de Teve was Cavaleiro and son of Goncalo de Teve, one ofthe first settlers of Sao Miguel, orignally from Paris, France andCatharina de Mesa was daughter of Fernao de Mesa and Isabel Francanatives of Spain, came to Sao Miguel in 1520 at the time of the ComuneroRevolt.<br />\nPero was Amoxarife and cousin to Antonio de Teve, tesoureiro-mor(treasurer) of the king(?) He went with the 5th Capitao Donatario, RuiGoncalves da Camara, and served in Africa and Tangiers and Arzila.<br />\nAlmoxarife Pedro de Teves was born in Calheta, S\u00e3o Miguel, A\u00e7ores. He died after 1537 in Ponta<br />\nDelgada, S\u00e3o Miguel, A\u00e7ores. He married Catarina Mezas.<br />\nPedro de Teve, segundo Almoxarife em S. Miguel e Cavaleiro, segundo se v\u00ea de uma procura\u00e7\u00e3o feita em Ponta Delgada em 1518, de que foi testemunha e onde \u00e9 tratado de Cavaleiro (\"Arquivo dos A\u00e7ores\", Vol III, p\u00e1g.\u00d9A 26). Era primo de Ant\u00f3nio de Teve, Tesoureiro-m\u00f3r do Reino (?). Em 1516 Pedro de Teve foi com o 5.\u00d9B Capit\u00e3o Donat\u00e1rio, Rui Gon\u00e7alves da C\u00e2mara, servir em \u00c1frica, em T\u00e2nger e Arzila (Frutuoso, Liv.\u00d9B IV, Cap.\u00d9B LXVIII). Fez testamento de m\u00e3o comum com sua mulher em 1537, no qual deixaram 5 alqueires de terra \u00e0 Miseric\u00f3rdia de Ponta Delgada, para sustenta\u00e7\u00e3o de uma cama no hospital. Casou com Catarina de Mesa (Cap.\u00d9B 13.\u00d9B \u00d9G \u00danico N.\u00d9B 2), a quem Frutuoso tamb\u00e9m chama Francisca, por\u00e9m o seu verdadeiro nome \u00e9 Catarina, como consta dos dois testamentos que fez, o primeiro de m\u00e3o comum com seu marido em 1537 e o segundo a 3.4.1561.\n</p>\n</div>\n</div>",
