"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n11) Domingas de Teve (N.\u00d9B 4 \u00d9G 3.\u00d9B)<br />\nDomingas de Teve \u00e9 citada no testamento de Rui Velho de Melo e de sua mulher Guiomar de Teve, de 11.12.l568, onde dizem terem dotado com 50 mil r\u00e9is esta sua neta. N\u00e3o sendo filha dos outros filhos de Rui Velho [de Melo] s\u00f3 pode ser de Rui Velho, o Mo\u00e7o e Ana de Aguiar. Seu marido Baltazar Sim\u00f5es Barreto casou a segunda vez com Clara de Azevedo (Cap.\u00d9B 200.\u00d9B \u00d9G 1.\u00d9B N.\u00d9B 3).<br />\nA 4.12.1650 em Ponta Delgada, Baltazar Sim\u00f5es Barreto, cidad\u00e3o e sua mulher Clara de Azevedo rectificam o dote que fizeram a sua filha Beatriz da Assun\u00e7\u00e3o para professar no Convento da Esperan\u00e7a de Ponta Delgada, dote constitu\u00eddo sobre o rendimento de uma terra que houveram em parte por heran\u00e7a de seu pai e sogro Ant\u00f3nio Marques e em parte por compra a seu cunhado Ant\u00f3nio Marques, estante no Brasil (Livro do Tombo do Convento da Esperan\u00e7a de Ponta Delgada, fls. 709, feito em 1701).<br />\nA 7.1.1633 em Ponta Delgada, Baltazar Sim\u00f5es Barreto por si e em nome de sua mulher Clara de Azevedo rectifica o dote que fez ao Convento da Esperan\u00e7a para a profiss\u00e3o de sua filha Maria dos Reis; no mesmo dia, sua mulher Clara de Azevedo, confirma essa rectifica\u00e7\u00e3o, assinando por ela, e seu rogo, seu irm\u00e3o Domingos Martins Marques (Notas dos tabeli\u00e3es Pedro Ferreira Serr\u00e3o, Jorge Palha de Macedo e Greg\u00f3rio Sanches Livro de 1630 a 1633). Baltazar Sim\u00f5es Barreto era natural da Ilha da Madeira, como se v\u00ea do alvar\u00e1 de 9.12.1632 para ser admitido aos cargos da governan\u00e7a. Seu pai Sim\u00e3o Pires da Concei\u00e7\u00e3o vinculou por testamento aprovado em 1561, deixando a administra\u00e7\u00e3o a sua mulher e depois a seu filho Baltazar [Sim\u00f5es Barreto] e descendentes dele. Casou com Maria Pires de Andrade, que tamb\u00e9m vinculou a sua ter\u00e7a por testamento aprovado a 26.9.1575. Foram irm\u00e3os de Baltazar Sim\u00f5es Barreto e por conseguinte filhos de Sim\u00e3o Pires da Concei\u00e7\u00e3o e Maria Pires de Andrade: Belchior Sim\u00f5es, lavrador e morador nos Arrifes, que em 1588-89 juntamente com o irm\u00e3o Baltazar [Sim\u00f5es Barreto] pagou \u00e0 Miseric\u00f3rdia de Ponta Delgada 11 alqueires de trigo da obriga\u00e7\u00e3o do testamento do pai; Filipa Sim\u00f5es, casada com Pedro Alves e Manuel Pires que vendeu uma casa \u00e0 Esperan\u00e7a por vinte mil r\u00e9is em 16.5.1578 a Jo\u00e3o Lopes do Porto (ma\u00e7o 1.\u00d9B dos papeis dos Jesu\u00edtas na Reparti\u00e7\u00e3o de Finan\u00e7as de Ponta Delgada).\n</p>\n</div>\n</div>",
