"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nGuiomar de Teve, que fez testamento com seu marido em Ponta Delgada a 11.12.1568, aprovado a 10.1.1569 e aberto por morte dele a 2.2.1569. Nele dizem serem fregueses da Matriz de Ponta Delgada onde querem ser sepultados. Casou com Rui Velho de Melo, ou Cabral (Cap.\u00d9B 97.\u00d9B \u00d9G 2.\u00d9B N.\u00d9B 2).\n</p>\n</div>\n</div>",
