"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nNo acto do matrim\u00f3nio os nubentes afirmam perante as testemunhas presentes terem j\u00e1 sete filhos, por nome uma Maria, outro Ant\u00f3nio, outra Ana, outro Manuel, outro Joaquim , outro Jo\u00e3o, outra Helena, os quais foram todos haviam sido baptizados por filhos deles contraentes, e que eles agora declaram por leg\u00edtimos, em verdade do que todos assinar\u00e3o e de que para isto lavrei este termo no sobredito dia, m\u00eas e ano.\n</p>\n</div>\n</div>",
