"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n1851, Ponta Delgada, Ilha de S\u00e3o Miguel\n</p>\n<p>\nManuel Ant\u00f3nio de Vasconcelos<br />\nA\u00e7oriano, nascido a 1851 em Ponta Delgada, era filho de Luis de Sousa Vasconcelos (n.1813.) e de Escol\u00e1stica Borges. O seu pai era o 8\u00ba filho de Manuel Joaquim de Vasconcelos, morgado, capit\u00e3o e sargento-m\u00f3r, nascido na Bretanha e a\u00ed falecido em 1829, e de Gertrudes Vic\u00eancia da C\u00e2mara.\n</p>\n<p>\nManuel Ant\u00f3nio de Vasconcelos foi o grande taxidermista do Museu Carlos Machado, e a quem se deve grande parte do acervo de esp\u00e9cimes a\u00e7orianos da cole\u00e7\u00e3o hist\u00f3rica do museu.\n</p>\n<p>\nEm meados do s\u00e9culo XIX, Carlos Machado, fundador do Museu A\u00e7oreano, mantinha como grande preocupa\u00e7\u00e3o a prepara\u00e7\u00e3o de animais que formavam um esp\u00f3lio zool\u00f3gico importante; no entanto, e embora a taxidermia fosse uma t\u00e9cnica muito conhecida internacionalmente, na ilha de S. Miguel n\u00e3o se encontrava qualquer especialista nessa mat\u00e9ria. Perante esse obst\u00e1culo, o Bar\u00e3o da Fonte Bela disponibilizou-se a custear a forma\u00e7\u00e3o em taxidermia a quem se designasse a incumb\u00eancia, tendo a escolha de Carlos Machado reca\u00eddo sobre Manuel Ant\u00f3nio de Vasconcelos.\n</p>\n<p>\nA taxidermia, ou arte de preparar e conservar os animais com apar\u00eancia de vivos, foi de grande import\u00e2ncia para a zoologia no Museu, e o fasc\u00ednio que cria aos seus visitantes. A necessidade de manter constante as caracter\u00edsticas morfol\u00f3gicas das esp\u00e9cies animais, para efeitos expositivos, distanciam esta disciplina de outras suas parentes, como a mumifica\u00e7\u00e3o; a diversidade de t\u00e9cnicas aplicadas ao \u201cempalhamento\u201d dos animais \u00e9, tamb\u00e9m, muito mais diversa: a multiplicidade de tipos de pele, a grande variedade de articula\u00e7\u00f5es pr\u00f3prias de cada esp\u00e9cie, e a forma como se movimentam, entre outras particularidades, fazem da taxidermia uma arte minuciosa e complexa.\n</p>\n<p>\nManuel Ant\u00f3nio de Vasconcelos concluiu a sua forma\u00e7\u00e3o em Lisboa em apenas tr\u00eas meses, aplicando logo de seguida os seus conhecimentos na cole\u00e7\u00e3o zool\u00f3gica do Museu, ent\u00e3o um museu de hist\u00f3ria natural. Pela valor ineg\u00e1vel do seu trabalho, recebeu o grau de Cavaleiro da Ordem de S. Tiago, pela m\u00e3o do Rei D. Carlos I.\n</p>\n</div>\n</div>",
