"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nFounder of the \"A\u00e7oreano Oriental,\" (18-4-1835) Portugal's oldest newspaper; co-founder of \"O Tempo\". (Jan. 1838) Member of the City Council of Ponta Delgada (12-Feb-1831-25-4-1836) and Member of Parliament (1836-1840).\n</p>\n<p>\nCapit\u00e3o.<br />\nDeputado \u00e0s Cortes.<br />\nAboliu o v\u00ednculo institu\u00eddo pelo Padre Jo\u00e3o de Sousa Vasconcellos, irm\u00e3o do seu trisav\u00f4 Manuel \u00c1lvares de Vasconcellos.<br />\nManuel Ant\u00f3nio de Vasconcelos, morgado e \u00faltimo administrador do v\u00ednculo da Lomba Grande, institu\u00eddo pelo padre Jo\u00e3o de Sousa Vasconcelos, que foi abolido por senten\u00e7a de 11.6.1841. Foi Deputado \u00e0s Cortes em 1837 e foi o fundador do jornal \u00d9SO A\u00e7oriano Oriental \u00d9S em Ponta Delgada Nasceu na freguesia da Ajuda, da Bretanha a 5.2.1796 e morreu em Rabo de Peixe a 10.10.1844, tendo casado na freguesia de Santos-O-Velho, de Lisboa, a 17.4.1838 com Hedwiges Maria dos Santos, natural de Lisboa, filha do comendador Ant\u00f3nio dos Santos da Fonseca e Gertrudes Hermit\u00e9ria de Ara\u00fajo Pereira.\n</p>\n<p>\nFounder of the \"A\u00e7oreano Oriental,\" (18-4-1835) Portugal's oldest newspaper; co-founder of \"O Tempo\". (Jan. 1838) Member of the City Council of Ponta Delgada (12-Feb-1831-25-4-1836) and Member of Parliament (1836-1840).\n</p>\n<p>\nCapit\u00e3o.<br />\nDeputado \u00e0s Cortes.<br />\nAboliu o v\u00ednculo institu\u00eddo pelo Padre Jo\u00e3o de Sousa Vasconcellos, irm\u00e3o do seu trisav\u00f4 Manuel \u00c1lvares de Vasconcellos.<br />\nManuel Ant\u00f3nio de Vasconcelos, morgado e \u00faltimo administrador do v\u00ednculo da Lomba Grande, institu\u00eddo pelo padre Jo\u00e3o de Sousa Vasconcelos, que foi abolido por senten\u00e7a de 11.6.1841. Foi Deputado \u00e0s Cortes em 1837 e foi o fundador do jornal \u00d9SO A\u00e7oriano Oriental \u00d9S em Ponta Delgada Nasceu na freguesia da Ajuda, da Bretanha a 5.2.1796 e morreu em Rabo de Peixe a 10.10.1844, tendo casado na freguesia de Santos-O-Velho, de Lisboa, a 17.4.1838 com Hedwiges Maria dos Santos, natural de Lisboa, filha do comendador Ant\u00f3nio dos Santos da Fonseca e Gertrudes Hermit\u00e9ria de Ara\u00fajo Pereira.\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMorgado e Jornalista\n</p>\n</div>\n</div>",
