"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAlso known as Iria de Vasconcelos: godmother in Bretanha on 30-7-1603.<br />\nMaria de Vasconcelos (do \u00d9G 1.\u00d9B), natural da Bretanha (Nota N.\u00d9B 21), casou na Bretanha a 22.10.1596 com Sim\u00e3o Dias Vult\u00e3o, filho de Sim\u00e3o Dias e Helena Vultoa (casados na Bretanha a 21.1.1569, n\u00e3o dizendo o termo os nomes dos pais dos nubentes).<br />\nSeus sogros Sim\u00e3o Dias e Helena Vultoa, casados na Bretanha a 21.1.1569 sem o termo dizer os nomes dos respectivos pais, tiveram al\u00e9m de Sim\u00e3o Dias Vult\u00e3o (que casou com Maria de Vasconcelos): Catarina Simoa, casada na Bretanha a 14.8.1594 com Sebasti\u00e3o Fernandes e Maria Gon\u00e7alves (Vid. Nota N.\u00d9B 4 deste Cap.\u00d9B).\n</p>\n<p>\nAlso known as Iria de Vasconcelos: godmother in Bretanha on 30-7-1603.<br />\nMaria de Vasconcelos (do \u00d9G 1.\u00d9B), natural da Bretanha (Nota N.\u00d9B 21), casou na Bretanha a 22.10.1596 com Sim\u00e3o Dias Vult\u00e3o, filho de Sim\u00e3o Dias e Helena Vultoa (casados na Bretanha a 21.1.1569, n\u00e3o dizendo o termo os nomes dos pais dos nubentes).<br />\nSeus sogros Sim\u00e3o Dias e Helena Vultoa, casados na Bretanha a 21.1.1569 sem o termo dizer os nomes dos respectivos pais, tiveram al\u00e9m de Sim\u00e3o Dias Vult\u00e3o (que casou com Maria de Vasconcelos): Catarina Simoa, casada na Bretanha a 14.8.1594 com Sebasti\u00e3o Fernandes e Maria Gon\u00e7alves (Vid. Nota N.\u00d9B 4 deste Cap.\u00d9B).\n</p>\n</div>\n</div>",
