"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nFall River Chapel\n</p>\n<p>\nCidalia M. Miranda\n</p>\n<p>\n( September 26, 2011 )<br />\nCidalia M. \"Maganina\" Miranda, 61, of Fall River, passed away Monday after a brief illness. Wife of Luis B. Miranda, with whom she shared 40 years of marriage. Born in Bretanha, St. Michael, Azores, daughter of the late Manuel Alves and Angelina (Pavao) Viveiros. Survivors include sons, Wilson and Cory Miranda of Fall River; daughter, Christine Miranda of Boston; sisters, Maria Jose Araujo of Brazil, Leonilde Massa of Venezuela, Juvelina Diogo of Fall River, Elvira Pimentel of Toronto, Canada, Helena de Melo of Quebec, Canada and Eduarda Oliveira of Westport; granddaughter, Aniyah Lee Rogers and several nieces and nephews. She was also sister of the late Manuel and Jose Viveiros. Her Funeral Mass was celebrated on Saturday, October 1, in Espirito Santo Church followed by her committal at Notre Dame Cemetery.\n</p>\n</div>\n</div>",
