"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLOUIS M. Diogo, 94, Pastor Emeritus of St. Elizabeth Parish in Bristol, died peacefully surrounded by his family and friends on Holy Saturday, April 4, 2015 at home.\n</p>\n<p>\nBorn December 11, 1920, in Bretanha, Sao Miguel, Azores, a son of the late Jose and Helena (de Sousa Faria) Diogo, he attended public schools in Sao Miguel, Azores. He completed studies for the priesthood at the Seminary of Angra, Azores, and was ordained a priest on June 23, 1946 in the Cathedral Church of Angra by Bishop Guilherme A. C. Guimaraes.\n</p>\n<p>\nFrom 1946 to 1953 Fr. Diogo was secretary in the Seminary in Angra. In 1954 he came to the United States and became assistant pastor for a short period at Jesus Saviour Parish in Newport then at St. Anthony Parish in West Warwick. In June 1957 he was transferred to St. Francis Xavier Parish in East Providence and in 1964 he returned to Jesus Saviour Parish in Newport. In December 1964 he became administrator of Our Lady of the Rosary Parish in Providence and served there until his transfer in 1972 to St. Elizabeth Parish, Bristol, also as administrator. In December 1983 Fr. Diogo was incardinated into the Diocese of Providence and appointed pastor of St. Elizabeth Parish, Bristol, where he served until his retirement in 1993.\n</p>\n<p>\nHe is survived by two brothers and two sisters, Francisco Diogo, Manuel Diogo, Mariana Silva and Idalina Carvalho, all of Vancouver, Canada; and many nieces, nephews, great nieces and great nephews.<br />\nHe was also the brother of the late Joaquim Diogo, Jose Diogo, Maria Arruda and Helena Mateus.\n</p>\n<p>\nCalling hours are respectfully omitted. A Mass of Christian Burial will be offered at 10am on Friday, April 10, 2015 at Our Lady of the Rosary Church, Traverse St., Providence. Private burial will follow.\n</p>\n</div>\n</div>",
