"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMaria C. (Diogo) Pavao, 105, of Fall River, passed away Sunday after a long illness. Widow of Luis R. Pavao. Born in Oraville, CA, daughter of the late Antonio M. and Mamie (Dooley) Diogo. She was a retired textile worker and a member of the Holy Rosary Society of Espirito Santo Church. Beloved mother of Odelia De Mello (husband-Jose), Joseph L. Pavao (wife-Marjorie), James S. Pavao (wife-Norberta), Adelaide Manosh, Ralph Pavao (wife-Linda), Manuel A. Pavao (wife-Diane), Madeline Teixeira (husband-Steven) and the late Isabel Raposa and Natalia Rackley; sister of Matilde Miranda, Gilda Cabral, Elvina Arruda, Lubelia Tavares and the late Leonora Rego, Jamie and Ralph Diogo, Emiliana Carvalho and Odilia Da Costa. She also leaves 26 grandchildren, many great grandchildren, great great grandchildren, nieces and nephews. Funeral Thursday at 9:00 AM from the Silva-Faria Funeral Home, 730 Bedford St., with her Funeral Mass to follow in Espirito Santo Church at 10:00. Interment St. Patrick Cemetery. Calling hours Wednesday 4-8 PM. www.silvafaria.com - See more at: http://www.legacy.com/obituaries/heraldnews/obituary.aspx?pid=174988855#sthash.bOg7L6k8.dpuf\n</p>\n</div>\n</div>",
