"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nOdilia(Diogo)DaCosta, age 75 of Westport, MA, passed away Sunday November 17, 2013 after a short illness with her loving family by her side. She was the wife of 56 years of Jose A DaCosta and daughter of the late Antonio Medeiros Diogo and Maime Elizabeth (Dooley) Diogo. Born in Rem\u00e9dios da Bretanha, S\u00e3o Miguel, A\u00e7ores, Odilia resided in Westport for most of her life and was a member of Our Lady of Grace Church and an active member of St. John\u2019s Holy Ghost Club of Fall River. She enjoyed entertaining, cooking and feeding everyone. She loved being around her family and friends and also loved traveling. She leaves a legacy of being the best cook in the world. Everyone enjoyed her delicious dishes. She will be forever missed.\n</p>\n<p>\nShe was the mother of Lori A. Jacques (husband Edward) of Hampton NH, Lisa M. Costa of Westport, MA, and Karen M. Medeiros (husband David) of Somerset, MA and the late Donna Lee (Costa) Cabral; sister of Maria Pavao, Matilde Miranda, Gilda Cabral, Elvina Arruda, Libelia Tavares and the late Leanor Rego, Emeliana Carvalho, Ralph and Jaime Diogo; grandmother of Kelly Oliveira, Brian Cabral, Daniel Sousa, Brandon Aguiar, Kyle Araujo, Destiny DaCosta, Amber Smith, twins Ethan and Aydan Medeiros; great grandmother of Jaiden Oliveira and Braylee Cabral; aunt to several nieces and nephews. She also leaves lots of wonderful friends.\n</p>\n<p>\nHer funeral will take place from the MANUEL ROGERS &amp; SONS FUNERAL HOME 1521 N. Main St., Fall River FRIDAY AT 8:30 A.M. with a Mass of Christian Burial in Our Lady of Grace Church, Westport at 10 A.M. Interment in Notre Dame Cemetery. Calling hours THURSDAY 1-4 &amp; 6-9 P.M. In Lieu of flowers donations to St. Jude Hospital P.O. Box 1000, Dept. 142, Memphis, TN 38148-0142\n</p>\n</div>\n</div>",
