"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n1 - Afonso Anes, dos Mosteiros, veio de Portugal por ocasi\u00e3o do descobrimento desta Ilha de S. Miguel e era cavaleiro do H\u00e1bito de Santiago (Vide Frutuoso Livro IV Cap.\u00d9B XII e XXXIV, LI e XCV). Ele e sua mulher institu\u00edram o anal na ermida de S. Jo\u00e3o, no adro da Miseric\u00f3rdia de Ponta Delgada para ser dito por um cl\u00e9rigo seu parente. Diz Francisco Afonso de Chaves de Melo autor da \u00d9SMargarita Animata\u00d9T que este Afonso Anes era cavaleiro do h\u00e1bito de S. L\u00e1zaro e veio de Portugal j\u00e1 casado, fazendo assento nos Mosteiros, e que dera o s\u00edtio em que se fundou o hospital da Miseric\u00f3rdia de Ponta Delgada. Frutuoso tamb\u00e9m diz que Afonso Anes era cavaleiro do H\u00e1bito de S. L\u00e1zaro (Nota N.\u00d9B 1). Casou com Catarina Fernandes, ou Anes.<br />\nTiveram:<br />\n2 - Maria Afonso, que segue:\n</p>\n<p>\n1 - Afonso Anes, dos Mosteiros, veio de Portugal por ocasi\u00e3o do descobrimento desta Ilha de S. Miguel e era cavaleiro do H\u00e1bito de Santiago (Vide Frutuoso Livro IV Cap.\u00d9B XII e XXXIV, LI e XCV). Ele e sua mulher institu\u00edram o anal na ermida de S. Jo\u00e3o, no adro da Miseric\u00f3rdia de Ponta Delgada para ser dito por um cl\u00e9rigo seu parente. Diz Francisco Afonso de Chaves de Melo autor da \u00d9SMargarita Animata\u00d9T que este Afonso Anes era cavaleiro do h\u00e1bito de S. L\u00e1zaro e veio de Portugal j\u00e1 casado, fazendo assento nos Mosteiros, e que dera o s\u00edtio em que se fundou o hospital da Miseric\u00f3rdia de Ponta Delgada. Frutuoso tamb\u00e9m diz que Afonso Anes era cavaleiro do H\u00e1bito de S. L\u00e1zaro (Nota N.\u00d9B 1). Casou com Catarina Fernandes, ou Anes.<br />\nTiveram:<br />\n2 - Maria Afonso, que segue:\n</p>\n</div>\n</div>",
