"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJose S. Farias, 71, of Fall River, passed away Aug 2nd, after a short illness. Husband of the late Lucy (Santos) Farias. Born in Bretanha, St. Michael, Azores, son of the late Manuel and Antoinette Faria. He was also the adopted son of the late Manuel and Alexandrinha Remigio Costa. He was a cook and bartender at Lindo\u2019s on Alden St. for many years. Beloved father of Carl (wife-Kerry), Roy, Joe (wife-Paula), Abel, Kevin (wife-Geni), Jonathan and Kayla Farias and Lilia Matos; brother of Antoinette Jordan, Tony Faria, Alda Faria, Louis and William Costa, Odelia Pavao and the late Maria Tavares, Manuel and Jaime Costa. Jose also leaves 10 grandchildren, 1 great grandchild, several nieces and nephews. Following his cremation, a Memorial Mass was celebrated on Tuesday, August 12, in Espirito Santo Church. His ashes were later interred in his family lot at St. Patrick Cemetery.\n</p>\n</div>\n</div>",
