"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nObituary for Manuel Fernandes\n</p>\n<p>\nManuel \u201cRemigio\u201d Fernandes, 89, of Providence passed away on May 9, 2014. He was the loving husband of Maria H. (Pavao) Fernandes for 60 years. Mr. Fernandes was born in Sao Miguel, Portugal, the son of the late Manuel and Guilhermina Fernandes.\n</p>\n<p>\nAfter his wife and family, music was a great love of his life. Mr. Fernandes began his musical career playing the saxophone and other wind instruments in the Portuguese Military Band, later becoming a composer / band leader in Portugal and in 1970 becoming the Band leader for the Holy Rosary Band in East Providence and after retirement Mr. Fernandes guided and conducted St. Anthony\u2019s band in Pawtucket. Mr. Fernandes was employed by Durastone in Lincoln, RI prior to his retirement in 1987.\n</p>\n<p>\nMr. Fernandes leaves behind a devoted family. Besides his wife, Maria Helena, he is survivied by his children: Mario J. Fernandes of Exeter, RI, and his companion, Marae Tesi, Otilia \u201cTillie\u201d Nobrega and husband John L. Nobrega of Cumberland, and Maria L. Davey and her companion, William Grady of Warwick, RI. He also leaves four grandchildren: Amanda Fernandes, Tiffany Fernandes, Derek Nobrega D.M.D., his wife Janelle and Tyler Davey.<br />\nMr. Fernandes is also survived by his loving sisters: Deolinda Vasconcelos, Maria Viveiros, Gilda Salvador, all of Fall River, Otilia Silveira, her husband Eduardo and a loving brother Jose Fernandes and his wife Isabel of Toronto, Canada. Mr. Fernandes is also the loving uncle of many nieces and nephews.\n</p>\n<p>\nThe funeral for Mr. Fernandes will be from the MANNING-HEFFERN Funeral Home, 68 Broadway, Pawtucket at 9:00 AM with a Mass of Christian Burial at St. Anthony\u2019s Church, 32 lawn Avenue, Pawtucket Monday at 10:00 AM to which relatives and friends are invited. His burial will be in Mt. St. Mary\u2019s Cemetery in Pawtucket. The calling hours for Mr. Fernandes will be Sunday, May 11th from 2:00 - 5:00 PM in the funeral home.\n</p>\n</div>\n</div>",
