"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAnt\u00f3nio Fernandes Furtado, do Nordeste, ou do Faial da Terra? Deve ser filho de Pedro Roiz de Ponta Gar\u00e7a e de uma filha de Fern\u00e3o Gil, e Isabel Roiz Furtado. Foi padrinho no Faial da Terra a 26.4.1578, de baptismo de Braz, filho de Jo\u00e3o Homem e Maria Gon\u00e7alves, e em Agua Retorta foi tamb\u00e9m padrinho a\u00ed a 27.3.1588 de Ant\u00f3nio, filho de Ant\u00f3nio Fagundo e Maria Pires. Frutuoso Refere-se a este Ant\u00f3nio Fernandes Furtado no \u00a7 XXI de Cap.\u00ba VIII do Liv.\u00ba IV.\n</p>\n</div>\n</div>",
