"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nIsabel Gon\u00e7alves, (Nota N.\u00d9B 2). Casou duas vezes na Candel\u00e1ria: a primeira a 17.10.1590 com Jo\u00e3o Roiz Pav\u00e3o (Cap.\u00d9B 39.\u00d9B \u00d9G 3.\u00d9B, N.\u00d9B 6); e a segunda a 10.2.1602 com o capit\u00e3o Amador Dias (Cap.\u00d9B 282\u00d9B \u00d9G 1.\u00d9B, N.\u00d9B 2).<br />\nO casamento de Isabel Gon\u00e7alves com Amador Dias, n\u00e3o diz ser ela, vi\u00fava e diz ser filha de Diogo Gon\u00e7alves e Margarida Gon\u00e7alves; o casamento de Isabel Gon\u00e7alves com Jo\u00e3o Roiz Pav\u00e3o diz ser ela, filha de Dom. os (?) Gon\u00e7alves e de Margarida Gon\u00e7alves. Nestas condi\u00e7\u00f5es pode muito bem ser que a Isabel Gon\u00e7alves casada com Jo\u00e3o Roiz Pav\u00e3o n\u00e3o seja a mesma que mais tarde casou com o capit\u00e3o Amador Dias.\n</p>\n</div>\n</div>",
