"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFounder of Chapel of Nossa Senhora da Piedade em Ponta Gar\u00e7a<br />\nO nome aparece como Guiomar Roiz e Medeiros. Casou com L\u00f4po Anes de Ara\u00fajo, natural de Viana e que era um dos principais var\u00f5es de entre Minho e Douro. Veio para S. Miguel em 1506.<br />\nLopo Anes de Ara\u00fajo, natural de Viana, veio para a ilha de S. Miguel cerca de 1506. Era morador em Vila Franca, onde foi Juiz dos \u00d3rf\u00e3os a 11.5.1522. Fundou a ermida de Nossa Senhora da Piedade em Ponta Gar\u00e7a (Frutuoso, Livro IV, Cap.\u00d9B XXXIX). Foi a \u00c9vora com procura\u00e7\u00e3o do Capit\u00e3o-Donat\u00e1rio Rui Gon\u00e7alves da C\u00e2mara e de sua mulher D. Filipa Coutinho (procura\u00e7\u00e3o feita a 17.4.1535) a fim de terminar uma demanda com o Mosteiro de Alcoba\u00e7a (Vide \"Arquivo dos A\u00e7ores\", Vol. III, p\u00e1g.\u00d9A 419). Teve um dote de seu sogro de mais de 50 moios de renda. (Vide \"Arquivo dos A\u00e7ores, Vol. I, p\u00e1g.\u00d9A. 339, Vol. III, p\u00e1g.\u00d9A 425, e Vol. XII, p\u00e1g.\u00d9A 124). Casou em S. Miguel com Guiomar Rodrigues de Medeiros (Cap.\u00d9B 20.\u00d9B \u00d9G \u00danico N.\u00d9B 2).<br />\n\u00d9G 75<br />\nN 1 LOPO ANNES DE ARA\u00daJO que diz o P.e Cordeiro na Hist\u00f3ria das Ilhas fls 198 N 172 que fora de Viana do Minho para a Ilha da Madeira digo de S. Miguel no ano de 1506 e d\u00e1 a entender era descendente de Alvaro Rodrigues de Ara\u00fajo comendador de Rio Frio no \u00d9G ..... casou na dita ilha com Guiomar Rodrigues Madeiros filha de Rui Vaz de Medeiros um dos Principais Povoadores da dita ilha digo da ilha da Madeira e sua mulher Ana Gon\u00e7alves de Mendon\u00e7a (NFP).\n</p>\n<p>\nLopo Anes de Ara\u00fajo, natural de Viana, veio para a ilha de S. Miguel cerca de 1506. Era morador em Vila Franca, onde foi Juiz dos \u00d3rf\u00e3os a 11.5.1522. Fundou a ermida de Nossa Senhora da Piedade em Ponta Gar\u00e7a (Frutuoso, Livro IV, Cap.\u00d9B XXXIX). Foi a \u00c9vora com procura\u00e7\u00e3o do Capit\u00e3o-Donat\u00e1rio Rui Gon\u00e7alves da C\u00e2mara e de sua mulher D. Filipa Coutinho (procura\u00e7\u00e3o feita a 17.4.1535) a fim de terminar uma demanda com o Mosteiro de Alcoba\u00e7a (Vide \"Arquivo dos A\u00e7ores\", Vol. III, p\u00e1g.\u00d9A 419). Teve um dote de seu sogro de mais de 50 moios de renda. (Vide \"Arquivo dos A\u00e7ores, Vol. I, p\u00e1g.\u00d9A. 339, Vol. III, p\u00e1g.\u00d9A 425, e Vol. XII, p\u00e1g.\u00d9A 124). Casou em S. Miguel com Guiomar Rodrigues de Medeiros (Cap.\u00d9B 20.\u00d9B \u00d9G \u00danico N.\u00d9B 2).<br />\n\u00d9G 75<br />\nN 1 LOPO ANNES DE ARA\u00daJO que diz o P.e Cordeiro na Hist\u00f3ria das Ilhas fls 198 N 172 que fora de Viana do Minho para a Ilha da Madeira digo de S. Miguel no ano de 1506 e d\u00e1 a entender era descendente de Alvaro Rodrigues de Ara\u00fajo comendador de Rio Frio no \u00d9G ..... casou na dita ilha com Guiomar Rodrigues Madeiros filha de Rui Vaz de Medeiros um dos Principais Povoadores da dita ilha digo da ilha da Madeira e sua mulher Ana Gon\u00e7alves de Mendon\u00e7a (NFP).\n</p>\n</div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n&nbsp;\n</p>\n<p>\nIndividual: john raposo [<br />\n- Nobili\u00e1rio de Fam\u00edlias de Portugal - Felgueiras Gaio<br />\n- Genealogias de S. Miguel e Santa Maria - Rodrigo Rodrigues<br />\n]<br />\nFamily: john raposo\n</p>\n</div>\n</div>",
